/* eslint-disable */

// 箱线图生成器
export default function boxplotOption(config, fileDataMap, xData, yDataArr, selectedChartType, seriesData, customOption = {}) {
    console.log('[boxplotOption] xData:', xData);
    console.log('[boxplotOption] yDataArr:', yDataArr);
    console.log('[boxplotOption] selectedChartType:', selectedChartType);
    console.log('[boxplotOption] seriesData:', seriesData);

    const { seriesList, seriesData: boxplotPack } = seriesData;

    return;
}
